import React, { useEffect, useState } from "react";

const Footer = () => {
  return (
    <footer className={`row mx-0 p-0 `}>
      <div className="col-12 py-5 mx-0 text-center">
        <h3>2020 Have a good night</h3>
      </div>
      <style jsx>
        {`
          footer {
            background: #326fa0;
            color: white;
            margin-top: 10%;
            width: 100%;
            padding-bottom: 20vh;
          }

          h3 {
            font-size: 2rem;
          }
        `}
      </style>
    </footer>
  );
};

export default Footer;
